import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

import '../src/styles/styles.scss';

import Home from './pages/Home';
import Weddell from './pages/projects/Weddell';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route
          exact
          path="/"
          render={() => {
            <Home />;
          }}
        />
        <Route
          path="/weddell"
          render={() => {
            <Weddell />;
          }}
        />
        {/* <Home /> */}
        {/* <Weddell /> */}
      </Switch>
    </div>
  );
}

export default App;
